import React from 'react';
import {
  Route,
  Switch
} from "react-router-dom";
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="website">
      <Switch>
        <Route/>
      </Switch>
      </div>
    </div>
  );
}

export default App;
